def maxOperations(nums, k):
    n = 0
    sto = 0
    while n<len(nums):
        if k>nums[n]:
            for i in range(len(nums)): 
                if nums[i]==k-nums[n] and n!=i:
                    nums.pop(i)
                    nums.pop(n)
                    sto+=1
                    break
            else:
                n+=1
        else:
            n+=1
    return [sto], len(nums)**2

